import React, {Component}  from "react";

class Servicios extends Component {
    render() { 
        return (
            <section class="py-6  bg-dark bg-opacity-10">
	<div class="container">
		<div class="row">
			<div class="col-md-12">
				<div class="p-5 mb-2 lc-block text-center">
					<div class="lc-block mb-4">
						<div editable="rich">
							<h2 class="fw-bold display-4">Our Services
							</h2>
						</div>
					</div>
					<div class="lc-block mb-5">
						<div editable="rich">
							<p class="  lead">This text briefly introduces visitors to your main services.</p>
						</div>
					</div>
				</div>
			</div>
		</div>
	</div>
</section>
        );
    }
}

export default Servicios;
